import React from 'react'

function PersionList() {
    const persons = [
        {
            id: 1,
            name: 'Noyon',
            age: 27,
            skill: 'Programmer'
        },
        {
            id: 2,
            name: 'Tithi',
            age: 26,
            skill: 'Nurseing'
        },
        {
            id: 3,
            name: 'Nihan',
            age: 1.5,
            skill: 'Playing'
        }
    ]
const personList = persons.map(p => <h2>I am {p.name}. I am {p.age} years old. I know {p.skill}.</h2>)
    return (
    <div>{personList}</div>
    )
}

export default PersionList
